import styled from "styled-components";

export const StyleCard = styled.div`
  width: 100%;
  height: 80%;
  background-color: var(--background);
  border-radius: 20px;
  opacity: 0.6;
  display: flex;
  align-items: center;
  flex-direction: column;
  gap: 10px;
`;
